import React from "react";
import { useParams } from "react-router-dom";
import YouTube from "react-youtube"; // Import the YouTube component

const Finalpage = () => {
  // Accessing parameters from the URL
  const { courseId } = useParams();

  // Assuming you have some data structure containing details for each course
  const courseDetails = {
    // Your course details here
  };

  if (!courseDetails) {
    // Handle the case where the course details are not available
    return <div>Course not found</div>;
  }

  // Options for the YouTube player
  const opts = {
    height: "315",
    width: "560",
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 1,
    },
  };

  return (
    <div className="final-page">
      <div className="course-details">
        <h1>{courseDetails.coursesName}</h1>
        {/* Add more details as needed */}
      </div>
      <div className="video-container">
        {/* Use the YouTube component */}
        <YouTube videoId={courseDetails.youtubeVideoURL} opts={opts} />
      </div>
      {/* Add more content based on your requirements */}
    </div>
  );
};

export default Finalpage;
